import React, { Component } from 'react'
import { Checkbox } from 'antd';
export default class Checkboxs extends Component {
    render() {
        function onChange(e) {
            console.log(`checked = ${e.target.checked}`);
        }
        return (
            <div>
                <Checkbox onChange={onChange}>Checkbox</Checkbox>
            </div>
        )
    }
}
